import React from "react";
import Img1 from "../slike/premierslika.jpg";
import Lastmatcheng from "../League components/Lastmatcheng";
import Nextmatcheng from "../League components/Nextmatcheng";
import Tableeng from "../League components/Tableeng";

const Premierleague = () => {
  return (
    <div className="absolute top-0 left-[250px] h-screen w-[calc(100%-250px)] ">
      <div className="w-full h-[50%]">
        <div className="h-full w-full bg-black bg-opacity-90 z-100">
          <img src={Img1} id="slika"></img>
        </div>
      </div>
      <div className="w-full h-[50%]">
        <div className="grid grid-cols-3">
          <div>
            {" "}
            <Lastmatcheng />{" "}
          </div>
          <div>
            {" "}
            <Nextmatcheng />{" "}
          </div>
          <div className="">
            {" "}
            <Tableeng />{" "}
          </div>
        </div>
      </div>
    </div>
  );
};

export default Premierleague;
